import axios from "axios"


const Home = () => {
    useEffect(() => {
        axios
          .get(`https://api.promotocrossapi.com`)
          .then(res => {
            const charArr = res.data.results;
            console.log("Starwars Character", charArr);
            setCharacters(charArr);
            console.log(charArr);
          })
          .catch(error => {
            console.log("data not returned", error);
          });
      }, []);

  return (
    <div className="App">
      <form>
        <label>
          Username:
          <input type="text" />
        </label>
      </form>
    </div>
  );
};

export default Home;
